		"text": "어제까지 5천원 수수료 붙을때 취소했어야했는데... 하.... 제발 가실분 연락주세요. 원가양도이고 보통 가까우면 직거래 해드리는데 사정상 직거래 불가합니다. 신분 확실합니다. 단순익명계정 아니고 저를 아시는 분도 계시고 기존에도 양도해드렸습니다. 자리는 좋은자리이고 후회하지않으실겁니다."
